import styled from 'styled-components';
import background from '../../assets/images/Backgorund.svg';
export const Container = styled.div`
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  height: 100vh;
  background-image: url(${background});
`;
